import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      <ComponentBox name="adit" />
      <ComponentBox name="didit" />
      <ComponentBox name="dodot" />
    </div>
  );
}

function ComponentBox(props) {
  return <div className="hi">Hello, {props.name}</div>;
}

export default App;
